import React, { Component} from "react";
import axios from 'axios'

export default class Content extends Component {
state = {
    photos: []
}

componentDidMount() {
    axios.get('http:localhost:5000')
        .then(res=> {
            const photos = res.data
            this.setState({photos})
        })
}


    render() {
        return(
            <div>
                {this.state.photos}
            </div>
        )
    }
}
